import {
  Image,
  Box,
  Breadcrumb,
  BreadcrumbItem,
  BreadcrumbLink,
  Text,
} from "@chakra-ui/react";
// icons
import { ChevronRightIcon } from "@chakra-ui/icons";
import NatureImg from "../../Assets/temp-img/7.jpg";
import { useNavigate } from "react-router-dom";

// fonts
import "@fontsource/montserrat";
import "@fontsource/poppins";

const BannerComponent = () => {
  return (
    <>
      <Box>
        <Image
          zIndex={"1"}
          src={NatureImg}
          objectFit={"cover"}
          width="100vw"
          height={"50vh"}
          alt="banner"
        />
      </Box>
      <MessageComponent />
    </>
  );
};
export default BannerComponent;

const MessageComponent = () => {
  const Navigate = useNavigate();
  return (
    <>
      <Box
        bg={"white"}
        border={{
          "2xl": "1px solid blue",
          xl: "1px solid pink",
          lg: "1px solid orange",
          md: "1px solid red",
        }}
        borderRadius="50%"
        pos={"relative"}
        left={{ "2xl": "45vw", lg: "50%" }}
        bottom={{ "2xl": "18vh" }}
        zIndex={"5"}
      >
        <Box
          display="flex"
          flexDirection="column"
          alignItems="center"
          gap="1rem"
          pos={"relative"}
          top={{ "2xl": "8vh" }}
        >
          <Text
            fontFamily={"montserrat"}
            fontWeight={"semibold"}
            fontSize={{ "2xl": "xl", xl: "lg", lg: "xl" }}
          >
            Products
          </Text>
        
        </Box>
      </Box>
    </>
  );
};
